pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "./interfaces/IMetadataManager.sol";

contract MetadataManager is Ownable, IMetadataManager {
	using Strings for uint256;
	string public baseTokenURI;

	uint256 public NAME_CHANGE_PRICE = 100 ether;
	uint256 public BIO_CHANGE_PRICE = 300 ether;

	// Placeholder stats, this implementation can be changed later.
	// All mappings have to be copied into the new implementation.
	// @TODO make sure reserved names can be ported later on by chaning the data structures a bit.
	struct Stats {
		uint256 level;
		uint256 armour;
	}

	mapping(uint256 => string) public bio;

	// Mapping from token ID to name
	mapping(uint256 => string) private _tokenName;

	mapping(uint256 => Stats) private _tokenStats;

	// Mapping if certain name string has already been reserved
	mapping(string => bool) private _nameReserved;

	event NameChange(uint256 indexed tokenId, string newName);
	event BioChange(uint256 indexed tokenId, string bio);

	constructor() public {
		setBaseURI("ipfs://QmbgqyoZ8fbj3sMSQ3cYbWJP6uWVebviPr6WYREXUUDqQW/");
	}

	function tokenURI(uint256 _tokenId) external view override returns (string memory) {
		// return string(abi.encodePacked("ipfs://QmeigNyGfEHzHYSKBh2Uq7q5d3MXd4djeDjzFhfHpoorkU"));
		return bytes(baseTokenURI).length > 0 ? string(abi.encodePacked(baseTokenURI, _tokenId.toString())) : "";
	}

	function setBaseURI(string memory _baseURI) public onlyOwner {
		baseTokenURI = _baseURI;
	}
}
